val fauna=listOf(
        cardModel("Black Drongo","The black drongo (Dicrurus macrocercus) is a small Asian passerine bird of the drongo family Dicruridae. It is a common resident breeder in much of tropical southern Asia from southwest Iran through India, Bangladesh and Sri Lanka east to southern China and Indonesia and accidental visitor of Japan. It is an all black bird with a distinctive forked tail and measures 28 cm (11 in) in length. It feeds on insects,and is perching conspicuously on a bare perch or along power or telephone lines.","data:image/jpeg;base64,"),
        cardModel("Emerald Dove","The common emerald dove (Chalcophaps indica), also called Asian emerald dove and grey-capped emerald dove, is a widespread resident breeding pigeon native to the tropical and subtropical parts of the Indian Subcontinent and Southeast Asia. The dove is also known by the names of green dove and green-winged pigeon. The common emerald dove is the state bird of the Indian state of Tamil Nadu. The Pacific emerald dove and Stephan's emerald dove were both considered conspecific.","data:image/jpeg;base64,"),
        cardModel("Golden Eagle","The golden eagle (Aquila chrysaetos) is a bird of prey living in the Northern Hemisphere. It is the most widely distributed species of eagle. Like all eagles, it belongs to the family Accipitridae. They are one of the best-known birds of prey in the Northern Hemisphere. These birds are dark brown, with lighter golden-brown plumage on their napes. Immature eagles of this species typically have white on the tail and often have white markings on the wings. Golden eagles use their agility and speed combined with powerful feet and large, sharp talons to hunt a variety of prey, mainly hares, rabbits, and marmots and other ground squirrels.Golden eagles maintain home ranges or territories that may be as large as 200 km2 (77 sq mi). They build large nests in cliffs and other high places to which they may return for several breeding years. Most breeding activities take place in the spring; they are monogamous and may remain together for several years or possibly for life. Females lay up to four eggs, and then incubate them for six weeks. Typically, one or two young survive to fledge in about three months.","data:image/jpeg;base64,"),
        cardModel("Great Hornbill","The great hornbill (Buceros bicornis), also known as the concave-casqued hornbill, great Indian hornbill or great pied hornbill, is one of the larger members of the hornbill family. It occurs in the Indian subcontinent and Southeast Asia. It is predominantly frugivorous, but also preys on small mammals, reptiles and birds. It has been listed as Vulnerable on the IUCN Red List since 2018. It is known to have lived for nearly 50 years in captivity. Due to its large size and colour, it is important in many tribal cultures and rituals. The Government of Kerala declared it as the official Kerala state bird.","data:image/jpeg;base64,"),
        cardModel("Grey Francolin","The grey francolin (Ortygornis pondicerianus) also known as manu moa or Chicken Bird is a species of francolin found in the plains and drier parts of the Indian subcontinent and Iran. This species was formerly also called the grey partridge, not to be confused with the European grey partridge. They are mainly ground-living birds and are found in open cultivated lands as well as scrub forest and their local name of teetar is based on their calls, a loud and repeated Ka-tee-tar...tee-tar which is produced by one or more birds. The term teetar can also refer to other partridges and quails. During the breeding season calling males attract challengers, and decoys were used to trap these birds especially for fighting.","data:image/jpeg;base64,"),
        cardModel("Elephant","Elephants are the largest existing land animals. Three living species are currently recognised: the African bush elephant, the African forest elephant, and the Asian elephant. They are an informal grouping within the subfamily Elephantinae of the order Proboscidea; extinct members include the mastodons. Elephantinae also contains several extinct groups, including the mammoths and straight-tusked elephants. African elephants have larger ears and concave backs, whereas Asian elephants have smaller ears, and convex or level backs. The distinctive features of all elephants include a long proboscis called a trunk, tusks, large ear flaps, massive legs, and tough but sensitive skin. The trunk is used for breathing, bringing food and water to the mouth, and grasping objects.","data:image/jpeg;base64,"),
        cardModel("Barking Deer","The Indian muntjac (Muntiacus muntjak), also called the southern red muntjac and barking deer, is a deer species native to South and Southeast Asia. It is listed as Least Concern on the IUCN Red List.This muntjac has soft, short, brownish or greyish hair, sometimes with creamy markings. It is among the smallest deer species. It is an omnivore and eats grass, fruit, shoots, seeds, bird eggs, and small animals, and occasionally scavenges on carrion. Its calls sound like barking, often when frightened by a predator, hence the common name barking deer. Males have canines, short antlers that usually branch just once near the base, and a large postorbital scent gland used to mark territories.","data:image/jpeg;base64,"),
        cardModel("Bharal","The bharal (Pseudois nayaur), also called the blue sheep, is a caprine native to the high Himalayas. It is the only member of the genus Pseudois. It occurs in India, Bhutan, China (in Gansu, Ningxia, Sichuan, Tibet, and Inner Mongolia), Myanmar, Nepal, and Pakistan.The bharal was also the focus of George Schaller and Peter Matthiessen's expedition to Nepal in 1973.","data:image/jpeg;base64,"),
        cardModel("Black Bear","The Asian black bear (Ursus thibetanus), also known as the Asiatic black bear, moon bear and white-chested bear, is a medium-sized bear species native to Asia that is largely adapted to an arboreal lifestyle.It lives in the Himalayas, southeastern Iran, the northern parts of the Indian subcontinent, the Korean Peninsula, China, the Russian Far East, the islands of Honsh and Shikoku in Japan, and Taiwan. It is listed as vulnerable on the IUCN Red List, and is threatened by deforestation and poaching for its body parts, which are used in traditional medicine.","data:image/jpeg;base64,"),
        cardModel("Goral","The Himalayan goral (Naemorhedus goral) is a bovid species native to the Himalayas. It is listed as Near Threatened on the IUCN Red List because the population is thought to be declining significantly due to habitat loss and hunting for meat.","data:image/jpeg;base64,"),
    )   
    val flora=listOf(
        cardModel("Capsella bursa pastoris","Capsella bursa-pastoris, known as shepherd's purse because of its triangular flat fruits, which are purse-like, is a small annual and ruderal flowering plant in the mustard family (Brassicaceae).It is native to eastern Europe and Asia minor,but is naturalized and considered a common weed in many parts of the world, especially in colder climates, including British Isles,where it is regarded as an archaeophyte, North America and China,but also in the Mediterranean and North Africa. C. bursa-pastoris is the second-most prolific wild plant in the world,and is common on cultivated ground and waysides and meadows.","data:image/jpeg;base64,"),
        cardModel("Cardamine impatiens","Cardamine impatiens, the narrowleaf bittercress or narrow-leaved bitter-cress,is a plant species in the genus Cardamine of the family Brassicaceae. It is a slender, biennial herb, that produces sterile leaves in the first year, one to several flowering stems during the next. Its leaves are pinnate with several pairs of lanceolate, dentate leaflets and a terminal, slightly longer leaflet. The short petals surpass the calyx by half of its length. The seeds are arranged in one row on each side of the central membrane of the narrow pod and are ejected out in a shower due to the tension formed as the seed pod (silique) dries. It grows on walls, open ground in shady places in forests usually disturbed by man.","data:image/jpeg;base64,"),
        cardModel("Viola odorata","Viola odorata is a species of flowering plant in the genus Viola, native to Europe and Asia. This small hardy herbaceous perennial is commonly known as wood violet,sweet violet, English violet,common violet, florist's violet,or garden violet. It has been introduced into North America and Australia.","data:image/jpeg;base64,"),
        cardModel("Hypericum oblongifolium","Hypericum oblongifolium, known as Pendant St. John's wort, is a species of flowering plant in Hypericum sect. Ascyreia.Hypericum oblongifolium extract has traditionally been used as a treatment for numerous ailments, including hepatitis, gastric ulcers, and bee stings. In addition, its extract has also been used as a dressing for external wounds and as a sedative, antispasmodic, and antiseptic.","data:image/jpeg;base64,"),
        cardModel("Linum usitatissimum","Flax, also known as common flax or linseed, is a flowering plant, Linum usitatissimum, in the family Linaceae. It is cultivated as a food and fiber crop in regions of the world with temperate climates. Textiles made from flax are known in Western countries as linen and are traditionally used for bed sheets, underclothes, and table linen. Its oil is known as linseed oil. In addition to referring to the plant, the word flax may refer to the unspun fibers of the flax plant. The plant species is known only as a cultivated plant and appears to have been domesticated just once from the wild species Linum bienne, called pale flax. The plants flax in New Zealand are, by contrast, members of the genus Phormium.","data:image/jpeg;base64,"),
        cardModel("Potentilla argyrophylla","Silver-leaved Cinquefoil is a beautiful Himalayan wildflower with clear yellow flowers and slivery strawberry-like leaves. Flowering stems are erect or basally slightly curved, 15-20 cm tall, together with leaf-stalks densely silvery velvety and hairy. Basal leaves are 5-10 cm including the stalk. Stipules are brown, membranous, silky white on the underside, later hairless. Leaves are 3-foliolate, with stalkless leaflets, obovate, elliptic, or broadly ovate, 1.5-2  1-1.5 cm. Leaflets are densely silvery on both sides. Base is wedge-shaped or broadly so, margin sharply toothed, tip blunt. Stem leaves are 2 or 3, shortly stalked, small. Stipules are green, ovate or ovate-lanceolate, herbaceous, velvet-hairy on the underside, margin entire, tip long-pointed. Flowers are borne in groups 2 or 3 at branch ends.","data:image/jpeg;base64,"),
        cardModel("Bergenia ciliata","Bergenia ciliata (fringed elephant's ears, winter begonia, hairy bergenia, Hindi & Sanskrit : Pashanbheda) is a plant species in the genus Bergenia, deciduous in USDA Zones 5 to 7, but usually remain semi-evergreen south of Zone 7.It is found in Northern India in Uttarakhand (Chamoli and other districts of Uttarakhand) and Himachal Pradesh (in district Shimla). This flower is related to the famous Phool Dei Festival celebrated in Uttarakhand. It is commonly known in India as Pathar phor buti.","data:image/jpeg;base64,"),
        cardModel("Cuminum cyminum","Cuminum cyminum is a flowering plant in the family Apiaceae, native to the Irano-Turanian Region. Its seeds  each one contained within a fruit, which is dried  are used in the cuisines of many cultures in both whole and ground form. Although cumin is thought to have uses in traditional medicine, there is no high-quality evidence that it is safe or effective as a therapeutic agent.","data:image/jpeg;base64,"),
        cardModel("Foeniculum vulgare","Fennel (Foeniculum vulgare) is a flowering plant species in the carrot family.It is a hardy, perennial herb with yellow flowers and feathery leaves. It is indigenous to the shores of the Mediterranean but has become widely naturalized in many parts of the world, especially on dry soils near the sea-coast and on riverbanks.","data:image/jpeg;base64,"),
        cardModel("Centella asiatica","Centella asiatica, commonly known as Gotu kola, kodavan, Indian pennywort and Asiatic pennywort, is a herbaceous, perennial plant in the flowering plant family Apiaceae.It is native to wetlands in the Caucasus, Tropical & Subtropical Old World to New Zealand and the West Pacific.It is used as a culinary vegetable and as a medicinal herb.","data:image/jpeg;base64,"),
         
    )